import React from 'react';
import '../css/Project.css';
import project from '../img/6.jpg';
import daily from '../img/dailyscr.jpg';
import darman from '../img/2.jpg';
import { useTranslation } from 'react-i18next';
import CustomPopup from './main/CustomPopup';


const Project = () => {
  const { t, i18n } = useTranslation();

  const [visibility, setVisibility] = useState(false);
  const [Css, setCss] = useState(false);
  const [Html, setHtml] = useState(false);
  const [Javascript, setJavascript] = useState(false);

  const popupCloseHandler = (e) => {
    setVisibility(e);
    setCss(e);
    setHtml(e);
    setJavascript(e);
  };
  return (
    <div id="project">
      <div className="proStyle">
        <div className="proTittle">
          <h2>{t('PROJEC')}</h2>
        </div>
        <div className="proinfo">
          <div className="perspective">
            <div className="pro">
              <div className="prophoto">
                <img src={project} alt="pro" />
              </div>
              <div className="aboutpro">
                <h4>{t('moshanir')}</h4>
              </div>
            </div>
          </div>
          <div className="perspective">
            <div className="pro">
              <div className="prophoto">
                <a href="http://dailyscribe.ir/">
                  <img src={daily} alt="pro" />
                </a>
              </div>
              <div className="aboutpro">
                <a href="http://dailyscribe.ir/">
                  {' '}
                  <h4>{t('dailyscribe')}</h4>
                </a>
              </div>
            </div>
          </div>
          <div className="perspective">
            <div className="pro">
              <div className="prophoto">
                <img src={darman} alt="pro" />
              </div>
              <div className="aboutpro">
                <h4>{t('darman')}</h4>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Project;
